 import React, { Component, Fragment } from 'react';
 import { Helmet } from 'react-helmet';

 class Play extends Component {
     render(){
         return(
             <Fragment>
                <Helmet><title>Nimelssa quiz page</title></Helmet>
                <div className="questions">
                
                 <h5>Who is the Currrnt H.O.D of The Department of Medical Laboratoty Science </h5>
                 <div className="options-container">
                    <p className="option">Dr Ekun</p>
                    <p className="option">Dr Nwankorie</p>
                 </div>
                 <div className="options-container">
                    <p className="option">Dr Adenipekun</p>
                    <p className="option">Dr Neighmogah</p>
                 </div>
                 <div className="buttons-container">
                     <buttons>Previous</buttons>
                     <buttons>Next</buttons>
                     <buttons>Quit</buttons>
                 </div>
             </div>
             </Fragment>
         )
         
     }
 }

 export default Play;
